import React, {useState} from 'react';
// import useState from 'react';
import Dropdown from 'react-bootstrap/dropdown'; 
import Button from 'react-bootstrap/Button';
import 'bootstrap/dist/css/bootstrap.min.css'; 
import './Header_bootstrap.css';
import logo from './logoAccretion.svg'; 

function Header_bootstrap() {
    const [showSub_buy, setSub_buy] = useState(false);

    handleMouseEnter_buy = () => setSub_buy(true); 
    handleMouseLeave_buy = () => setSub_buy(false); 

    return (
        <header className="header">
            <img 
                src={logo} 
                className="header_logo"
            /> 
            <Dropdown className='menu_container'
                      onMouseEnter={handleMouseEnter_buy}
                      onMouseLeave={handleMouseLeave_buy}>
                <Dropdown.Toggle variant='outline-primary' id='dropdown-basic'>
                    Buy
                </Dropdown.Toggle>
                <Dropdown.Menu show={showSub_buy}>
                    <Dropdown.Item>
                        Home
                    </Dropdown.Item>
                    <Dropdown.Item>
                        Office
                    </Dropdown.Item>
                    <Dropdown.Item>
                        Commercial
                    </Dropdown.Item>
                </Dropdown.Menu>
            </Dropdown>
            <Dropdown className='menu_container'>
                <Dropdown.Toggle variant='outline-primary' id='dropdown-basic'>
                    Sell
                </Dropdown.Toggle>
                <Dropdown.Menu>
                    <Dropdown.Item>
                        Home
                    </Dropdown.Item>
                    <Dropdown.Item>
                        Office
                    </Dropdown.Item>
                    <Dropdown.Item>
                        Commercial
                    </Dropdown.Item>
                </Dropdown.Menu>
            </Dropdown>
            <div className='menu_container'> 
                <Button variant='outline-primary' className='header_button'> 
                    About Us
                </Button>
            </div>
        </header>
    );
}

export default Header_bootstrap;
